import React, { useEffect } from "react";
import { useState } from "react";
import BackToTop from "react-back-to-top";

export default function Backtotop() {
  return (
    <BackToTop
      mainStyle={{
        width: "100%",
        height: "100%",
        backgroundColor: "white",
        borderRadius: "10px",
        color: "red !important"

      }}
      percentStyle={{
        width: "100%",
        height: "100%",
        display: "none"
      }}
      animate="rotate"
      offsetTop={10}
      step={100}
      percent={true}
      visiblePercent={20}
      text={"Top"}
      
    />
  );
}
